classes.content:
self {
	cursor: pointer;
  	background-image: linear-gradient(to right, #cc75ca , #6a36ca);
}
self:hover {
	opacity: 0.8;
}
self:active {
	opacity: 1;
}

self {
  background-color : #ffffffff;
  box-shadow : 0px 0px 6px 0px #00000023;
  display : flex;
  flex-direction : column;
  align-items : start;
  justify-content : flex-start;
  gap : 10px;
  margin-top : 0px;
  border-width : 1px;
  border-radius : 20px;
	}
